import React, { useEffect, useState } from "react";
import Option from "../Options/Option";

const QuizQue = ({ que }) => {
  const { question, options,id } = que;
  return (
    <div className="grid">
      <h2>Que: {question}</h2>
      {options.map((option) => (
        <Option key={id} option={option}></Option>
      ))}
    </div>
  );
};

export default QuizQue;
